insert into dbo.TreatmentBMP(TenantID, StormwaterJurisdictionID,TreatmentBMPTypeID, OwnerOrganizationID, TreatmentBMPName, LocationPoint, SystemOfRecordID, Notes)
select 2 as TenantID, 12 as StormwaterJurisdictionID, 35 as TreatmentBMPTypeID, 26 as OwnerOrganizationID, b.TreatmentBMPName, b.LocationPoint, b.SystemOfRecordID, b.Notes
from #TreatmentBMP b
left join dbo.TreatmentBMP tb on b.TreatmentBMPName = tb.TreatmentBMPName
where tb.TreatmentBMPID is null

declare @customAttributeTypeID int, @treatmentBMPTypeCustomAttributeTypeID int

-- Number of Pipe Connector Screens
select @customAttributeTypeID = 91, @treatmentBMPTypeCustomAttributeTypeID = 503

insert into dbo.CustomAttribute(TenantID, TreatmentBMPID, TreatmentBMPTypeCustomAttributeTypeID, TreatmentBMPTypeID, CustomAttributeTypeID)
select b.TenantID, b.TreatmentBMPID, @treatmentBMPTypeCustomAttributeTypeID as TreatmentBMPTypeCustomAttributeTypeID, b.TreatmentBMPTypeID, @customAttributeTypeID as CustomAttributeTypeID
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
left join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.NumberOfConnectorPipeScreens is not null and ca.CustomAttributeID is null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select b.TenantID, ca.CustomAttributeID, tb.NumberOfConnectorPipeScreens
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.NumberOfConnectorPipeScreens is not null

-- TrashAndDebrisStorageVolume
select @customAttributeTypeID = 94, @treatmentBMPTypeCustomAttributeTypeID = 509

insert into dbo.CustomAttribute(TenantID, TreatmentBMPID, TreatmentBMPTypeCustomAttributeTypeID, TreatmentBMPTypeID, CustomAttributeTypeID)
select b.TenantID, b.TreatmentBMPID, @treatmentBMPTypeCustomAttributeTypeID as TreatmentBMPTypeCustomAttributeTypeID, b.TreatmentBMPTypeID, 94 as CustomAttributeTypeID
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
left join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.TrashAndDebrisStorageVolume is not null and ca.CustomAttributeID is null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select b.TenantID, ca.CustomAttributeID, tb.TrashAndDebrisStorageVolume
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.TrashAndDebrisStorageVolume is not null

-- TrashAndDebrisStorageVolume
select @customAttributeTypeID = 97, @treatmentBMPTypeCustomAttributeTypeID = 521

insert into dbo.CustomAttribute(TenantID, TreatmentBMPID, TreatmentBMPTypeCustomAttributeTypeID, TreatmentBMPTypeID, CustomAttributeTypeID)
select b.TenantID, b.TreatmentBMPID, @treatmentBMPTypeCustomAttributeTypeID as TreatmentBMPTypeCustomAttributeTypeID, b.TreatmentBMPTypeID, @customAttributeTypeID as CustomAttributeTypeID
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
left join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.NumberOfTrashBaskets is not null and ca.CustomAttributeID is null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select b.TenantID, ca.CustomAttributeID, tb.NumberOfTrashBaskets
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.NumberOfTrashBaskets is not null

-- MaintenanceArea
select @customAttributeTypeID = 1115, @treatmentBMPTypeCustomAttributeTypeID = 1587

insert into dbo.CustomAttribute(TenantID, TreatmentBMPID, TreatmentBMPTypeCustomAttributeTypeID, TreatmentBMPTypeID, CustomAttributeTypeID)
select b.TenantID, b.TreatmentBMPID, @treatmentBMPTypeCustomAttributeTypeID as TreatmentBMPTypeCustomAttributeTypeID, b.TreatmentBMPTypeID, @customAttributeTypeID as CustomAttributeTypeID
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
left join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.MaintenanceArea is not null and ca.CustomAttributeID is null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select b.TenantID, ca.CustomAttributeID, tb.MaintenanceArea
from #TreatmentBMP tb
join dbo.TreatmentBMP b on tb.TreatmentBMPName = b.TreatmentBMPName
join dbo.CustomAttribute ca on b.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = @customAttributeTypeID
where tb.MaintenanceArea is not null



